import React from "react";

const NavBar = () => {
  return (
    <div>
      <nav>
        <div>
          <a href="#">Inicio</a>
          <a href="#">Pokemones</a>
          <a href="#">Lolcito</a>
        </div>
      </nav>
    </div>
  );
};

export default NavBar;
